import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Input from '@material-ui/core/Input';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';
import Button from '@material-ui/core/Button';
import InputLabel from '@material-ui/core/InputLabel';
import FormControl from '@material-ui/core/FormControl';
import { DateRangePicker } from 'rsuite';
import 'rsuite/dist/styles/rsuite-default.css';
import {RegistrationList} from '../RegistrationList/index'

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
    },
    formControl: {
        margin: theme.spacing(1),
        minWidth: 120,
      },
  }));

  export const RegistrationFilter = () => {
    const classes = useStyles();
    const [age, setAge] = React.useState('');
    const handleChange = (event) => {
      setAge(event.target.value);
    };
    return (
      <div className={classes.root}>
        <Grid container spacing={3}>
          <Grid item xs>
            <Paper className={classes.paper}>
                <Input placeholder="Mã thành viên" inputProps={{ 'aria-label': 'description' }} />
            </Paper>
          </Grid>
          <Grid item xs>
            <Paper className={classes.paper}>
                <Input placeholder="Mã tin" inputProps={{ 'aria-label': 'description' }} />
            </Paper>
          </Grid>

          <Grid item xs>
            <Paper className={classes.paper}>
               <Button>Tìm kiếm</Button>
            </Paper>
          </Grid>
        </Grid>
        <Grid container spacing={3}>
          <Grid item xs>
            <Paper className={classes.paper}>
                <div className='dates'>
                    <DateRangePicker appearance='default' placeholder='Từ ngày-Đến ngày' style={{ width: 280 }} />
                </div>
            </Paper>
          </Grid>
          <Grid item xs>
            <Paper className={classes.paper}>
            <FormControl className={classes.formControl}>
                <InputLabel id="demo-simple-select-label">Tình trạng duyệt</InputLabel>
                <Select
                labelId="demo-simple-select-label"
                id="demo-simple-select"
                value={age}
                onChange={handleChange}
                >
                <MenuItem value={10}>Đã duyệt</MenuItem>
                <MenuItem value={20}>Chờ duyệt</MenuItem>
                <MenuItem value={30}>Từ chối</MenuItem>
                </Select>
            </FormControl>
            </Paper>
          </Grid>
          <Grid item xs>
            <Paper className={classes.paper}></Paper>
          </Grid>
        </Grid>
      </div>
    );
  }
